export type Project = {
  name: string;
  description: string;
  id: number;
  tasks?: {
    queue: Task[];
    development: Task[];
    done: Task[];
  };
};

export type UserAction = {
  type: string;
  payload: Project;
};

export enum Actions {
  AddProject = 'ADD_PROJECT',
  AddTask = 'ADD_TASK',
}

export type Task = {
  number: number;
  name: string;
  description: string;
  dateCreate: string;
  timeInWork: string;
  expirationDate: string;
  priority: string;
  files: string;
  status: string;
  subtasks?: string;
};
